  @override
  String get celtic_cross_screen_celtic_cross_explanation_dialog =>
      'Ο «Κελτικός Σταυρός» είναι μια διάταξη με 10 κάρτες που αναλύει λεπτομερώς την κατάσταση από όλες τις πλευρές: τις τρέχουσες συνθήκες, τα εμπόδια, τις εσωτερικές και εξωτερικές επιρροές, καθώς και τη κοντινή δυναμική και το τελικό αποτέλεσμα. Οι κάρτες τοποθετούνται με τη σειρά:\n1 - Κατάσταση — η ουσία του ζητήματος εδώ και τώρα.\n2 - Πρόκληση — αυτό που βοηθά ή εμποδίζει την πρόοδο.\n3 - Υποσυνείδητο (ρίζα) — κρυφά κίνητρα και βαθιές δυνάμεις.\n4 - Πρόσφατο παρελθόν — γεγονότα που οδήγησαν στην τρέχουσα κατάσταση.\n5 - Συνειδητό (στόχος) — αυτό στο οποίο εστιάζει τώρα ο ερωτών.\n6 - Άμεσο μέλλον — πιθανή εξέλιξη τις επόμενες εβδομάδες.\n7 - «Εγώ ο ίδιος» — εσωτερική κατάσταση, πόροι, στάση απέναντι στο ζήτημα.\n8 - Περιβάλλον — επιρροές από ανθρώπους και περιστάσεις γύρω.\n9 - Ελπίδες / φόβοι — προσδοκίες, αμφιβολίες, έντονα συναισθήματα.\n10 - Αποτέλεσμα — πιθανό αποτέλεσμα αν οι τάσεις συνεχιστούν.\nΑυτή η διάταξη επιτρέπει να δείτε την «μεγάλη εικόνα»: πού βρίσκεστε, τι εμποδίζει ή βοηθά, ποιοι κρυφοί παρορμητισμοί λειτουργούν στα παρασκήνια και προς τα πού κινείται όλο αυτό.\nΤο σχήμα της διάταξης παρουσιάζεται στην εικόνα παρακάτω.';

