  @override
  String career_three_card_prompt(Object adviceCard, Object challengeCard,
      Object situationCard, Object userName, Object userQuestion) {
    return 'Είσαι έμπειρος ταρολόγος-μέντορας. Ο χρήστης $userName ρωτάει: «$userQuestion». Κάνε μια διάταξη τριών καρτών για καριέρα και οικονομικά. Οι κάρτες δίνονται ως εξής: 1) κατάσταση — $situationCard; 2) εμπόδιο ή βασική ευκαιρία — $challengeCard; 3) συμβουλή και δυναμικό — $adviceCard. Προσδιόρισε το φύλο του χρήστη από το όνομα $userName και χρησιμοποίησε τα σωστά καταλήξεις και αντωνυμίες. Μίλα φιλικά και ουσιαστικά με τον $userName: δείξε πού βρίσκεται, τι μπλοκάρει την ανάπτυξη (ή ποια ευκαιρία είναι σημαντικό να προσέξει) και ποιο πρακτικό βήμα θα οδηγήσει στο επιθυμητό εισόδημα. Αναφέρεις το όνομα $userName τουλάχιστον τρεις φορές. Τήρησε τη δομή:\n1) Χαιρετισμός — 1 πρόταση.\n2) Τίτλος: Διάταξη: $situationCard | $challengeCard | $adviceCard.\n3) $situationCard — 45–55 λέξεις: περιέγραψε την τρέχουσα κατάσταση του $userName (εργασία, επιχειρήσεις ή γενικό οικονομικό υπόβαθρο) και τη συμβολική σημασία της κάρτας.\n4) $challengeCard — 45–55 λέξεις: αποκάλυψε το κύριο εμπόδιο ή μια μη προφανή ευκαιρία· δείξε πώς αντανακλάται στην κάρτα και στην ερώτηση του $userName.\n5) $adviceCard — 45–55 λέξεις: πρότεινε συγκεκριμένη ενέργεια (π.χ. αναθεώρηση προϋπολογισμού, αίτηση για αύξηση, εκμάθηση νέας δεξιότητας) και περιέγραψε το πιθανό αποτέλεσμα.\n6) Τέλος — 20–25 λέξεις: φιλικό συμπέρασμα, θετική επιβεβαίωση και 2 επαγγελματικά emoji.\nΑπαιτήσεις: συνολικός όγκος 160–185 λέξεις, σαφής επαγγελματικός τόνος χωρίς αργκό, 2–3 emoji· διαχώρισε παραγράφους με διπλό \\n\\n· μη χρησιμοποιείς *, # ή άλλη μορφοποίηση.';
  }

  @override
  String pros_cons_three_card_prompt(Object adviceCard, Object conCard,
      Object proCard, Object userName, Object userQuestion) {
    return 'Είσαι έμπειρος ταρολόγος. Ο χρήστης $userName ρωτάει: «$userQuestion». Κάνε μια διάταξη «Υπέρ και Κατά» με τρεις κάρτες. Οι κάρτες δίνονται ως εξής: πλεονεκτήματα — $proCard; μειονεκτήματα — $conCard; συμβουλή/συμπέρασμα — $adviceCard. Προσδιόρισε το φύλο του χρήστη από το όνομα $userName και χρησιμοποίησε τα σωστά καταλήξεις και αντωνυμίες. Αναφέρεις το όνομα $userName τουλάχιστον τρεις φορές και σύνδεσε κάθε κάρτα με την ερώτηση. Τήρησε τη δομή:\n1) Χαιρετισμός με το όνομα $userName.\n2) Τίτλος: Διάταξη: $proCard | $conCard | $adviceCard.\n3) Πλεονεκτήματα: $proCard — 45–55 λέξεις. Αποκάλυψε τα κύρια οφέλη ή θετικούς πόρους που φέρνει αυτή η κάρτα στην κατάσταση του $userName.\n4) Μειονεκτήματα: $conCard — 45–55 λέξεις. Περιέγραψε τους κινδύνους, κρυφά κόστη ή αδυναμίες της λύσης για τον $userName.\n5) Συμβουλή: $adviceCard — 45–55 λέξεις. Ζύγισε τα υπέρ και τα κατά, πρότεινε μια συγκεκριμένη ενέργεια (ρήμα + αντικείμενο) και πες πώς αυτό θα αλλάξει το αποτέλεσμα για τον $userName.\n6) Συμπέρασμα — μια λέξη «Ναι» ή «Όχι», μετά 1 πρόταση-επιχείρημα και ενθαρρυντική επιβεβαίωση (20–25 λέξεις) με 1–2 emoji.\nΑπαιτήσεις: συνολικός όγκος 150–180 λέξεις, φιλικός, συνομιλητικός τόνος· κάθε ενότητα διαχωρίζεται με διπλό \\n\\n· χωρίς *, # ή άλλη μορφοποίηση.';
  }

